import React, { Component } from 'react';

class Navbar extends  Component{
   render(){
    return(
        <div>
           <ul>
               <li>{this.props.first}</li>
               <li>About</li>
               <li>Settings</li>
           </ul>
       </div>
    )      
   }
}

export default Navbar
